function checkCashRegister(price, cash, cid) {
  var change;
  var currency = ["PENNY", "NICKEL", "DIME", "QUARTER", "ONE", "FIVE","TEN","TWENTY","ONE HUNDRED"];
  var amt = [.01 , .05 , .1 , .25 , 1 , 5 , 10 , 20 , 100];
  // Here is your change, ma'am.
  var change = cash - price;

  var remainInDrawer = function(chg, drawer){
    var total = 0;
    for(let i = 0; i < drawer.length; i++){
      total += drawer[i][1];

    }

    return total - chg;

  }


  var remainder = remainInDrawer(change, cid);

  if( remainder < 0){
    return {status: "INSUFFICIENT_FUNDS", change: []};
  }
  else if(remainder === 0){
     return {status: "CLOSED", change: cid};
  }
  else{
    var i = amt.length - 1;
    var arr = [];
    while (change > 0 && i >= 0){
      if(change >=amt[i]){
       var amountCanTake = Math.floor(change/amt[i]) * amt[i];
       if(amountCanTake > cid[i][1]){
          change-=cid[i][1];
          arr.push(cid[i]);
        }
        else{

          change= change - amountCanTake;
          arr.push([currency[i],amountCanTake]);

        }


      }
      change = Math.round(change * 100) / 100;
      i--;
    }
    if(change > 0){
      return {status: "INSUFFICIENT_FUNDS", change: []};
    }

    return {status: "OPEN", change: arr};
  }



}


